import React from 'react';
import {StyleSheet, css} from "aphrodite";

function HoverText({child, flex}) {
    const style = StyleSheet({
        container:{
            flex:flex,
        },
        hover:{
          ":hover":{
              cursor:"pointer",
          }
        }
    })
    return (
        <div className={css(style.container, style.hover)} onMouseEnter={()=>console.log("SDa")}>
            {child}
        </div>
    );
}

export default HoverText;
